export default function App() {
  return <Nav />;
}
function Nav() {
  return (
    <nav>
      <img></img>
      <div className="first-nav nav">
        <h4>june 20 , 2024</h4>
        <p>X active Tasks</p>
      </div>
      <div className="first-nav nav">
        <h1>To do List</h1>
      </div>
      <div className="first-nav nav">
        <img src="../data/Humaaans - Plant 1.png" alt="logo" />
      </div>
    </nav>
  );
}
